.i-desc {
    width: 100%;
    margin-bottom: 10px;

    .ct-item {
        width: 100%;
        display: flex;
        flex-direction: row;
        flex-wrap: wrap;

        .label {
            width: 10%;
            text-align-last: justify;
            margin-right: 2%;
        }

        .c-input {
            width: 85%;
            text-indent: 10px;
        }
    }
}

.eva {
    width: 100%;

    .eva-title {
        font-weight: 800;
        margin-bottom: 10px;
    }

    .rate-score {
        display: flex;
        flex-direction: row;

        .product {
            display: flex;
            flex-direction: row;
            align-items: center;
            font-size: 12px;
            line-height: 1.5;
            font-weight: 500;

            .item-label {
                margin-right: 5px;
            }
        }
    }

    .ev-content {
        font-weight: 800;
        line-height: 1.5;
        margin-top: 10px;
        margin-bottom: 10px;

        span {
            font-weight: 800;
            margin-right: 10px;
        }
    }

    .rate-img {
        display: flex;
        align-items: center;

        .img-item {
            width: 16%;

            img {
                width: 60px;
                height: 60px;
                border-radius: 4px;
            }
        }
    }
}

.w-dia {
    border: none;

    .el-dialog__body {
        padding: 1px 20px;
        padding-left: 35px;
    }

    .el-dialog__title {
        font-size: 14px;
    }

    border: 1px solid #DCDFE6;
    padding: 10px;
    border-radius: 10px;
    margin-bottom: 30px;
}

.dia-content {
    display: flex;
    font-family: "Helvetica Neue", Helvetica, "PingFang SC", "Hiragino Sans GB", "Microsoft YaHei", "微软雅黑", Arial, sans-serif;
    font-size: 12px;
    flex-direction: row;
    flex-wrap: wrap;

    .c-data {
        width: 45%;
        margin-bottom: 15px;

        .c-title {
            font-weight: 800;
            margin-bottom: 10px;

        }

        .el-select--mini {
            width: 100%;
        }

        .el-cascader--mini {
            width: 100%;

            .el-input__suffix {
                right: -6px;
            }
        }

        .ct-item {
            display: flex;
            flex-direction: row;
            text-align-last: justify;
            align-items: center;
            margin-bottom: 3px;

            .d_code {
                display: flex;
                flex-direction: row;
                width: 60%;

                .el-select {
                    width: 50%;
                }
            }

            .label {
                width: 28%;
                margin-right: 10px;

            }

        }
    }
}

.n-post {
    .el-dialog__body {
        padding: 10px 10px;

        .el-form-item__label {
            font-weight: 400;
            font-size: 12px;
        }
    }

}

.is_link {
    .el-input__inner {
        color: #4646ff !important;
    }
}
